script: |
  super -f tsv -I q8562.sql | sort > q8562.out

vector: true

inputs:
  - name: q8562.sql
    data: |
      SELECT DISTINCT 12 AS col1 FROM tab0 WHERE - col1 NOT BETWEEN - + col1 * 80 * + 91 * + ( - col0 ) + col1 + col0 AND NULL;
  - name: tab0

outputs:
  - name: q8562.out
    data: |
      12
